 method_cb.active;\nconst f_act = filter_cb.active;\nconst mod_act = model_toggle.active;\nconst sep = offset_slider.value;\n\n// curvas y residuos\nfor (let i=0; i&lt;renderers.length; i++){\n    const R = renderers[i];\n    const mi = R.method_index, fi = R.filter_index;\n    const show = m_act.includes(mi) &amp;&amp; f_act.includes(fi);\n    R.scatter.visible = R.error.visible = R.resid_scatter.visible = R.resid_error.visible = show;\n    // modelo\n    R.model.visible = mod_act.includes(mi) &amp;&amp; f_act.includes(fi);\n    // offset vertical\n    const d = R.source.data;\n    const off = sep * (mi * n_filters + fi);\n    for (let j=0; j&lt;d.y.length; j++){\n        d.y[j]     = d.orig_y[j]     + off;\n        d.model[j] = d.orig_model[j] + off;\n        d.resid[j] = d.orig_resid[j] + off;\n        d.upper[j] = d.y[j] + d.yerr[j];\n        d.lower[j] = d.y[j] - d.yerr[j];\n        d.upper_r[j]= d.resid[j] + d.yerr[j];\n        d.lower_r[j]= d.resid[j] - d.yerr[j];\n    }\n    R.source.change.emit();\n}\n\n// ruido correlado\nfor (let i=0; i&lt;renderers_rn.length; i++){\n    const R = renderers_rn[i];\n    const mi = R.method_index, fi = R.filter_index;\n    const show = m_act.includes(mi) &amp;&amp; f_act.includes(fi);\n    R.curve.visible = R.error.visible = show;\n    R.gaussian.visible = show;\n}\n\n// luego de togglear renderers_rn\u2026\nconst items3 = [];\nfor (let i = 0; i &lt; renderers_rn.length; i++) {\n  if (renderers_rn[i].curve.visible) {\n    items3.push(new LegendItem({\n      label:  { value: legend_items_rn[i] },\n      renderers: [ renderers_rn[i].curve ]\n    }));\n  }\n}\nconst legend3 = new Legend({ items: items3, orientation: \"horizontal\", location: \"top_center\" });\np3.add_layout(legend3, 'above');\n\n\n// reconstruir leyenda\nconst items = [];\nfor (let i=0; i&lt;renderers.length; i++){\n    if (renderers[i].scatter.visible){\n        items.push( new LegendItem({\n            label: { value: legend_items[i] },\n            renderers: [ renderers[i].scatter ]\n        }) );\n    }\n}\nlegend.items = items;\n"}}]]]},"labels":["gau1","gau3","st","w3","w5","w7"]}},{"id":"p2380"},{"id":"p2381"},{"id":"p2382"}]}},{"type":"object","name":"Figure","id":"p1001","attributes":{"width":1500,"height":800,"x_range":{"type":"object","name":"DataRange1d","id":"p1002"},"y_range":{"type":"object","name":"DataRange1d","id":"p1003"},"x_scale":{"type":"object","name":"LinearScale","id":"p1011"},"y_scale":{"type":"object","name":"LinearScale","id":"p1012"},"title":{"type":"object","name":"Title","id":"p1004"},"renderers":[{"id":"p1145"},{"id":"p1154"},{"id":"p1187"},{"id":"p1196"},{"id":"p1229"},{"id":"p1238"},{"id":"p1271"},{"id":"p1280"},{"id":"p1313"},{"id":"p1322"},{"id":"p1355"},{"id":"p1364"},{"id":"p1397"},{"id":"p1406"},{"id":"p1439"},{"id":"p1448"},{"id":"p1481"},{"id":"p1490"},{"id":"p1523"},{"id":"p1532"},{"id":"p1565"},{"id":"p1574"},{"id":"p1607"},{"id":"p1616"},{"id":"p1649"},{"id":"p1658"},{"id":"p1691"},{"id":"p1700"},{"id":"p1733"},{"id":"p1742"},{"id":"p1775"},{"id":"p1784"},{"id":"p1817"},{"id":"p1826"},{"id":"p1859"},{"id":"p1868"}],"toolbar":{"type":"object","name":"Toolbar","id":"p1010","attributes":{"tools":[{"type":"object","name":"PanTool","id":"p1023"},{"type":"object","name":"WheelZoomTool","id":"p1024","attributes":{"dimensions":"width","renderers":"auto"}},{"type":"object","name":"WheelZoomTool","id":"p1025","attributes":{"dimensions":"height","renderers":"auto"}},{"type":"object","name":"BoxZoomTool","id":"p1026","attributes":{"dimensions":"both","overlay":{"type":"object","name":"BoxAnnotation","id":"p1027","attributes":{"syncable":false,"line_color":"black","line_alpha":1.0,"line_width":2,"line_dash":[4,4],"fill_color":"lightgrey","fill_alpha":0.5,"level":"overlay","visible":false,"left":{"type":"number","value":"nan"},"right":{"type":"number","value":"nan"},"top":{"type":"number","value":"nan"},"bottom":{"type":"number","value":"nan"},"left_units":"canvas","right_units":"canvas","
